import { combineReducers, legacy_createStore } from "redux";
import profileReducer from "./profileReducer";

let reducers = combineReducers({
    profileReducer: profileReducer,
    dialoguesReducer,
    sidebarReducer
});

let store = legacy_createStore();

export default store;
